import styled from 'styled-components';

export const Container = styled.div`
    width: 300px;
    height: 100px;
    background: #20295F;
    display: flex;
    border-radius: 5px;

    img {
        width: 25px;
        height: 25px;
    }
    span {
        color: #FFF;
        font-weight: bold;
    }
`;
